- input: "TEXT\x1CC00310607\x1CTEXT1\x1C\x1CF3A\x1CThis amendment only modifies one
    thing in the Q1 report.  Two checks were originally written to Lampson for Congress,
    and one was voided.  We made two entries for the two checks: one a positive $2000
    and one a negative $2000 (to represent the voided check).  Unfortunately, this
    effectively cancels out the $2000 contribution, as we discovered when reconciling
    the reports, and leaves us $2000 short on line 21, other disbursements.  In order
    to make sure the $2000 Lampson check is reported correctly, this report is being
    amended to show two positive $2000 checks and one negative $2000 (to represent
    the voided check).  This was simply an error in data entry and we are now correcting
    it.  Thanks for your understanding."
