      entries for the two checks: one a positive $2000 and one a negative $2000 (to
      represent the voided check).  Unfortunately, this effectively cancels out the
      $2000 contribution, as we discovered when reconciling the reports, and leaves
      us $2000 short on line 21, other disbursements.  In order to make sure the $2000
      Lampson check is reported correctly, this report is being amended to show two
